import $ from 'jquery'
import React, { useState } from 'react';


const Slider = () =>{
const [state, setState ] = useState({
    slider: '1'
})



return(
    <div data-delay={4000} data-animation="slide" data-autoplay={1} data-easing="ease-in-out" data-duration={500} data-infinite={1} className="af-class-slider w-slider">
    <div className="w-slider-mask">
      <div className="af-class-slide af-class-slide-1 w-slide" ></div>
      <div className="af-class-slide af-class-slide-2 w-slide" ></div>
      <div className="af-class-slide af-class-slide-3 w-slide" ></div>
      <div className="af-class-slide af-class-slide-4 w-slide" ></div>
      <div className="af-class-slide af-class-slide-5 w-slide" ></div>
    </div>
    <div className="af-class-left-arrow w-slider-arrow-left">
      <div className="w-icon-slider-left" ></div>
    </div>
    <div className="af-class-right-arrow w-slider-arrow-right">
      <div className="w-icon-slider-right" ></div>
    </div>
    <div className="af-class-slide-nav w-slider-nav w-round" ></div>
  </div>

)

}

export default Slider;
